import React from 'react';
import { Box, Typography, Grid, Paper, useTheme } from '@mui/material';
import { motion } from 'framer-motion';

const Skills: React.FC = () => {
  const theme = useTheme();
  const skills = {
    languages: ['C++', 'Python', 'JavaScript', 'TypeScript'],
    webDev: ['Angular', 'HTML', 'CSS', 'Tailwind', 'Figma', 'MERN Stack'],
    databases: ['MySQL', 'MongoDB'],
    tools: ['Git', 'Zoho', 'MS Excel', 'MS Office', 'Adobe Photoshop']
  };

  const strengths = [
    'Effective communication and public speaking skills',
    'Strong teamwork and leadership abilities',
    'Problem-solving mindset with attention to detail',
    'Strong organizational and multitasking abilities'
  ];

  const SkillCategory: React.FC<{ title: string; skills: string[] }> = ({ title, skills }) => (
    <Box sx={{ mb: 3 }}>
      <Typography variant="h6" gutterBottom sx={{ color: theme.palette.primary.main }}>
        {title}
      </Typography>
      <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 1 }}>
        {skills.map((skill, index) => (
          <motion.div
            key={index}
            initial={{ opacity: 0, scale: 0.8 }}
            whileInView={{ opacity: 1, scale: 1 }}
            transition={{ duration: 0.3, delay: index * 0.1 }}
            viewport={{ once: true }}
          >
            <Paper
              elevation={2}
              sx={{
                px: 2,
                py: 1,
                backgroundColor: theme.palette.primary.light,
                color: 'white',
                borderRadius: '20px',
                transition: 'all 0.3s ease',
                '&:hover': {
                  backgroundColor: theme.palette.primary.main,
                  transform: 'translateY(-2px)',
                }
              }}
            >
              <Typography variant="body2">{skill}</Typography>
            </Paper>
          </motion.div>
        ))}
      </Box>
    </Box>
  );

  return (
    <Box sx={{ py: 4 }}>
      <Typography 
        variant="h4" 
        gutterBottom 
        sx={{ 
          textAlign: 'center',
          mb: 4,
          color: theme.palette.primary.main,
          position: 'relative',
          '&::after': {
            content: '""',
            position: 'absolute',
            bottom: -8,
            left: '50%',
            transform: 'translateX(-50%)',
            width: '60px',
            height: '4px',
            backgroundColor: theme.palette.secondary.main,
            borderRadius: '2px'
          }
        }}
      >
        Skills & Strengths
      </Typography>

      <Grid container spacing={4}>
        <Grid item xs={12} md={8}>
          <Paper elevation={3} sx={{ p: 3 }}>
            <SkillCategory title="Languages" skills={skills.languages} />
            <SkillCategory title="Web Development" skills={skills.webDev} />
            <SkillCategory title="Databases" skills={skills.databases} />
            <SkillCategory title="Tools" skills={skills.tools} />
          </Paper>
        </Grid>
        <Grid item xs={12} md={4}>
          <Paper elevation={3} sx={{ p: 3, height: '100%' }}>
            <Typography variant="h6" gutterBottom sx={{ color: theme.palette.primary.main }}>
              Strengths
            </Typography>
            <Box component="ul" sx={{ pl: 2 }}>
              {strengths.map((strength, index) => (
                <motion.li
                  key={index}
                  initial={{ opacity: 0, x: -20 }}
                  whileInView={{ opacity: 1, x: 0 }}
                  transition={{ duration: 0.3, delay: index * 0.1 }}
                  viewport={{ once: true }}
                >
                  <Typography variant="body1" sx={{ mb: 1 }}>
                    {strength}
                  </Typography>
                </motion.li>
              ))}
            </Box>
          </Paper>
        </Grid>
      </Grid>
    </Box>
  );
};

export default Skills;
